import React from 'react'
import Box from '@mui/material/Box';


const Sidebar = () => {

    return (
        <Box 
        bdcolor="skyblue"
        flex={1} 
        p={2}
        sx={{display: {xs: "none", sm:"block" } }}

         > 
         <List>
             <ListItem disablePadding>
                 <ListItemButton component="a">

                 </ListItemButton>

             </ListItem>
         </List>




         </Box>
    );

};

export default Sidebar
